import React from "react";

const UserDetails = ({ user }) => {
  return (
    <div>
      <h2>User Details</h2>
      <p>User Name: {user.username}</p>
      <p>Email: {user.email}</p>
      <p>Mobile: {user.phone}</p>
    </div>
  );
};

export default UserDetails;
